def bmi_cat(i):
    if 18.5 > i:
      return 'underweith'
    elif 18.5 <= i <= 25:
      return 'normalweith'
    elif 25 < i <= 30:
      return 'overweith'
    elif i > 30:
      return 'obese'



df['obes'] = df['bmi'].apply(lambda i: bmi_cat(i))

